import React from 'react';

import './product.css';

export const Product = () => {
    return (
        <div>
            <div className="contenedor-producto">
                <div className="imagen-principal"></div>
                <div className="subImagen-1"></div>
                <div className="subImagen-2"></div>
                <div className="subImagen-3"></div>
                <div className="subImagen-4"></div>
            </div>
        </div>
    )
}
